postcontent:
I make custom grips for handguns, specifically the Sig P938.  These grips are all hand made by me at my home.  I have several wood selections, and the option of 7 different finishes.  Included are some pictures of a few of the grips I have done for others recently.  I can do some other guns, email for more details!

Currently available in hand wood;
Cocobolo, Paduk, Purpleheart, Bloodwood, Black Palm, Chechen, Jabota, Honduran Rosewood, Walnut, Bacote, Marblewood, Quina, Mora,  Lacewood, Chestnut, Caranda, Mesquite, Ebony, Rainbow poplar, Panga Panga, Black Walnut, and Ziricote

Offered finishes;
Polyurethane gloss, polyurethane semi-gloss, polyurethane satin, laquer, tung oil, clear flat, clear gloss, and on some woods they can be just sanded down smooth and left natural.
